import React from 'react';
import logo from './logo.svg';
import './App.css';
import {allCards} from './services/cardService'

async function loadNames() {
  const response = await fetch('https://people.canonical.com/~anthonydillon/wp-json/wp/v2/posts.json');
  const names = await response.json();
  console.log(names); 
  const result = Object.entries(names);
  console.log(result)
  for (const k in result) {
    const b = result[k];
    //console.log(b);
    const resu = Object.entries(b);
    const text: any = resu[1][1];
    const text1: any = text['title']['rendered']
    console.log(text1)
  }
  // logs [{ name: 'Joker'}, { name: 'Batman' }]
}
//loadNames();
allCards();

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
